evel 4",["LEVEL_10_TITLE"] = "abandoned land",["LEVEL_11_HEROIC"] = "Hero Mode Description 11",["LEVEL_11_HISTORY"] = "It's not easy to cross a bleak valley! We are nearing the end of our journey, and although we are destitute, our hearts are still full of lofty goals. nnBut be careful... It's full of rocks and flame titans... Better not disturb them! ",["LEVEL_11_IRON"] = "Steel Mode Description 11",["LEVEL_11_IRON_UNLOCK"] = "no artillery nno bow tower",["LEVEL_11_MODES_UPGRADES"] = "Level 5",["LEVEL_11_TITLE"] = "Valley of Desolation",["LEVEL_12_HEROIC"] = "Hero Mode Description 12",["LEVEL_12_HISTORY"] = "Our troops have surrounded the evil wizard Weiznan's Tower. It's time to do the math... It's time for the final showdown. This is the ultimate battle to defend the security of the kingdom. We have come to this point step by step; There is no way back. Now is our time to show courage! ",["LEVEL_12_IRON"] = "Steel Mode Description 12",["LEVEL_12_IRON_UNLOCK"] = "no artillery",["LEVEL_12_MODES_UPGRADES"] = "Level 5",["LEVEL_12_TITLE"] = "Tower of Darkness",["LEVEL_13_HEROIC"] = "Hero Mode Description 13",["LEVEL_13_HISTORY"] = "General! We need you and your brave men! One of the terrifying spider queens, Sareguez has awakened! We thought they would never wake up, but Sareguez, with the power of darkness, took over the remnants of Weiznan's forces. You must destroy them and take out Sareguez! ",["LEVEL_13_IRON"] = "Steel Mode Description 13",["LEVEL_13_IRON_UNLOCK"] = "no artillery nunable to divide the tower",["LEVEL_13_MODES_UPGRADES"] = "Level 5",["LEVEL_13_TITLE"] = "Sareguez's lair",["LEVEL_14_HEROIC"] = "Hero Mode Description 14",["LEVEL_14_HISTORY"] = "Guardians of Linevera! Although the kingdom has achieved peace, evil will never go away! Our spies have reported that the ruins of Acarus have been invaded by an army of orcs and goblins. After the new orc warlord Gurak took over, his army is reigning terror on the area. You must drive these intruders out of the Holy Land! ",["LEVEL_14_IRON"] = "Steel Mode Description 14",["LEVEL_14_IRON_UNLOCK"] = "no bow tower nno barracks",["LEVEL_14_MODES_UPGRADES"] = "Level 5",["LEVEL_14_TITLE"] = "Ruins of Acarus",["LEVEL_15_HEROIC"] = "Hero Mode Description 15",["LEVEL_15_HISTORY"] = "Summon your troops, General! The dark forces are rising again, and we must act. The spies reported that a portal to hell opened in the middle of the decaying forest. The dead will not find rest in this place, and plants will also be malicious to those who enter. You must lead the army into it and find the source of the problem! ",["LEVEL_15_IRON"] = "Steel Mode Description 15",["LEVEL_15_IRON_UNLOCK"] = "no bow tower nno artillery",["LEVEL_15_MODES_UPGRADES"] = "Level 5",["LEVEL_15_TITLE"] = "decaying forest",["LEVEL_16_HEROIC"] = "Hero Mode Description 15",["LEVEL_16_HISTORY"] = "General, you must once again protect our kingdom from the enemy! The spies reported that a group of evil criminals were gathering in the depths of the Silent Forest. Yes, it is the silent forest that few cityrs dare to step on. Immediately lead the army into the forest and destroy these villains. Let them regret the day they decided to go down the path of crime! ",["LEVEL_16_IRON"] = "Steel Mode Description 15",["LEVEL_16_IRON_UNLOCK"] = "tower without bow and arrownunable to master tower",["LEVEL_16_MODES_UPGRADES"] = "Level 5",["LEVEL_16_TITLE"] = "Silent Forest",["LEVEL_17_HEROIC"] = "Hero Mode Description 15",["LEVEL_17_HISTORY"] = "Well done! You have succeeded in driving away the vile criminals. Your combined combat power has defeated most of the enemy's guerrilla forces, but they are fleeing deeper into the forest. We have reason to believe that there is also a nest of theirs inside, where all the loot is accumulated. Catch up and lure them out of their nests! ",["LEVEL_17_IRON"] = "Steel Mode Description 16",["LEVEL_17_IRON_UNLOCK"] = "unable to divide the tower nno artillery",["LEVEL_17_MODES_UPGRADES"] = "Level 5",["LEVEL_17_TITLE"] = "robber's lair",["LEVEL_18_HEROIC"] = "Hero Mode Description 15",["LEVEL_18_HISTORY"] = "Pack your winter clothes, soldiers; We are about to depart for the Glacier Highlands! The locals reported unrest, and the king ordered us to go to the heights to investigate the reports. Be careful, because the highlands are the frozen tombs of many ill-prepared explorers",["LEVEL_18_IRON"] = "Steel Mode Description 15",["LEVEL_18_IRON_UNLOCK"] = "tower without bow and arrownunable to master tower",["LEVEL_18_MODES_UPGRADES"] = "Level 5",["LEVEL_18_TITLE"] = "glacial highlands",["LEVEL_19_HEROIC"] = "Hero Mode Description 15",["LEVEL_19_HISTORY"] = "We now know that the unrest in the north was caused by the troll warlord Aguk Khan! If we do not try to stop him, his army will surely be overwhelming from the north and threaten the good people of Lineveria. Prepare to fight the ferocious armies of the Hakraj and go head-to-head with their evil leader on their territory! ",["LEVEL_19_IRON"] = "Steel Mode Description 15",["LEVEL_19_IRON_UNLOCK"] = "no barracksnno division tower",["LEVEL_19_MODES_UPGRADES"] = "Level 5",["LEVEL_19_TITLE"] = "Hakraj Plateau",["LEVEL_1_HEROIC"] = "Hero Mode Description 1",["LEVEL_1_HISTORY"] = "Hello, modder! As a general in His Majesty's army, King Dinas needs your help. Residents of Nangang City reported being attacked by roadblocks and other outlaws. You'll lead a team to Nangang to support the town's defenses. Good luck, General! ",["LEVEL_1_IRON"] = "Steel Mode Description 1",["LEVEL_1_IRON_UNLOCK"] = "tower without bow and arrownunable to master tower",["LEVEL_1_MODES_UPGRADES"] = "Level 1 highestnNo heroes",["LEVEL_1_TITLE"] = "Southport",["LEVEL_20_HEROIC"] = "Hero Mode Description 15",["LEVEL_20_HISTORY"] = "The demons wiped out our troops stationed at the Tower of Weznan, leaving only one survivor... From his frightened nonsense, we learn that these vicious tribes climbed up from the abyss of the cracks of ashes. General, you must secure this area, find the source of the threat, and make sure that we really defeat Weiznan",["LEVEL_20_IRON"] = "Steel Mode Description 15",["LEVEL_20_IRON_UNLOCK"] = "Unable to Master Tower",["LEVEL_20_MODES_UPGRADES"] = "Level 5",["LEVEL_20_TITLE"] = "Pit of Fire",["LEVEL_21_HEROIC"] = "Hero Mode Description 15",["LEVEL_21_HISTORY"] = "We are facing Molok, one of the great leaders of the hellish demons. Our sages have discovered that he is the one who opens the portal to the Hall of All Devils, where his power will be incomparably strong. You swear to follow the king, even if it is to escape into hell... Now, this is where you're going...",["LEVEL_21_IRON"] = "Steel Mode Description 15",["LEVEL_21_IRON_UNLOCK"] = "no artillery",["LEVEL_21_MODES_UPGRADES"] = "Level 5",["LEVEL_21_TITLE"] = "Hall of All Devils",["LEVEL_22_HEROIC"] = "Hero Mode Description 15",["LEVEL_22_HISTORY"] = "The letter eagle brought news from the elven fortress of the Decaying Forest. The entire forest is still corrupted by evil, and our elven allies are fighting off the fearsome monsters. New dark forces are on the rise, trying to expand their sphere of influence beyond the forest. Hurry up, General, we must set out to support our elven friends! ",["LEVEL_22_IRON"] = "Steel Mode Description 15",["LEVEL_22_IRON_UNLOCK"] = "no bow tower nno artillery",["LEVEL_22_MODES_UPGRADES"] = "Level 5",["LEVEL_22_TITLE"] = "fungal forest",["LEVEL_23_HEROIC"] = "Hero Mode Description 23",["LEVEL_23_HISTORY"] = "General, our kingdom is in danger again! King Banesti of neighboring Ninoma is captured by his enemies in the Valley of Sorrows on his way to participate in the Great Kingdom Tournament. nnThe quickest way to the Valley of Sorrows is probably the Royal Road, but along the way it will pass through the infamous Rotten Core Town",["LEVEL_23_IRON"] = "Hero Mode Description 23",["LEVEL_23_IRON_UNLOCK"] = "no barracksnno artillery",["LEVEL_23_MODES_UPGRADES"] = "Level 5",["LEVEL_23_TITLE"] = "Spoiled Town",["LEVEL_24_HEROIC"] = "Hero Mode Description 24",["LEVEL_24_HISTORY"] = "Looking back at the ambush in the town of Rotten Core, it is really scary, fortunately we have followed the royal road to the necropolis! As we passed through a large number of ancient burial chambers and looted tombs, the soldiers became restless when they saw a large number of graves being dug up. This unusual silence only makes the situation worse. Undoubtedly, this is a harbinger of another brewing attack by the dark forces",["LEVEL_24_IRON"] = "Hero Mode Description 24",["LEVEL_24_IRON_UNLOCK"] = "tower without bow and arrownunable to master tower",["LEVEL_24_MODES_UPGRADES"] = "Level 5",["LEVEL_24_TITLE"] = "Ancient Necropolis",["LEVEL_25_HEROIC"] = "Hero Mode Description 25",["LEVEL_25_HISTORY"] = "On the way to the Demon King Blackburn Castle, there is hardly a place more filthy than the disgusting swamp. Large numbers of witches gathered, and the chanting of incantations filled the air, in secret symphony with the roar of hungry beasts. They used to be servants of a noble knight. And now in the pool of decay, through dozens of corpses, gazing at us with hollow eye sockets...",["LEVEL_25_IRON"] = "Hero Mode Description 25",["LEVEL_25_IRON_UNLOCK"] = "no bow tower nno barracks",["LEVEL_25_MODES_UPGRADES"] = "Level 5",["LEVEL_25_TITLE"] = "Night Swamp",["LEVEL_26_HEROIC"] = "Hero Mode Description 26",["LEVEL_26_HISTORY"] = "When we look at this fallen warrior, our hearts are filled with sadness. Blackburn was so power-seeking that he was corrupted by power in order to fight evil, and even his territory fell into darkness. Unfortunately, we couldn't save him; But we were able to save King Banesti from the gallows. Defeat the demon king Blackburn, maybe death will bring him salvation! ",["LEVEL_26_IRON"] = "Hero Mode Description 26",["LEVEL_26_IRON_UNLOCK"] = "no bow tower nno artillery",["LEVEL_26_MODES_UPGRADES"] = "Level 5",["LEVEL_26_TITLE"] = "Blackburn Castle",["LEVEL_27_HISTORY"] = "General, it seems as though a mass wave of enemies have had a death wish, let us grant it to them, the history has been enlarged due to luka(this is a joke level and the level next to it)",["LEVEL_27_IRON_UNLOCK"] = "no bow tower nno artillery",["LEVEL_27_HEROIC"] = "Hero Mode Description 26",["LEVEL_27_IRON"] = "Hero Mode Description 26",["LEVEL_27_MODES_UPGRADES"] = "Level 5",["LEVEL_27_TITLE"] = "masse valley",["LEVEL_28_HISTORY"] = "this is an average day at sandhawk, of course the day wouldn't be average if it didn't get attacked",["LEVEL_28_IRON_UNLOCK"] = "no bow tower nno artillery",["LEVEL_28_HEROIC"] = "Hero Mode Description 26",["LEVEL_28_IRON"] = "Hero Mode Description 26",["LEVEL_28_MODES_UPGRADES"] = "Level 5",["LEVEL_28_TITLE"] = "average day at Sandhawk hamlet",["LEVEL_29_HISTORY"] = "General! We have received a call for help from city of Lozagon! It seems that they were attacked by never seen before horde of goblins. We don't know where they came from, but we have to send help. Let's hope that Time Wizards will be able to hold off on their own until we arrive...",["LEVEL_29_IRON_UNLOCK"] = "no bow tower nno artillery",["LEVEL_29_HEROIC"] = "Hero Mode Description 26",["LEVEL_29_IRON"] = "Hero Mode Description 26",["LEVEL_29_MODES_UPGRADES"] = "Level 5",["LEVEL_29_TITLE"] = "City of Lozagon",["LEVEL_2_HEROIC"] = "Hero Mode Description 2",["LEVEL_2_HISTORY"] = "Well done! Your diligent investigation shows that this is not simply a bandit haunting the southern harbor, but an organized attack by a goblin-like tribe! Now, their forward forces are approaching the outskirts north of the port. nnWe must quickly build effective fortifications",["LEVEL_2_IRON"] = "Steel Mode Description 2",["LEVEL_2_IRON_UNLOCK"] = "no barracks",["LEVEL_2_MODES_UPGRADES"] = "Level 2 highestnNo heroes",["LEVEL_2_TITLE"] = "suburbs",["LEVEL_3_HEROIC"] = "Hero Mode Description 2",["LEVEL_3_HISTORY"] = "While your men are still reveling in the joy of fighting off goblins and orcs, we have received another bad news. The town of Pagras is now surrounded by overwhelming enemy forces. This is clearly an open declaration of war on the kingdom! The war has begun! ",["LEVEL_3_IRON"] = "Steel Mode Description 2",["LEVEL_3_IRON_UNLOCK"] = "no artillery",["LEVEL_3_MODES_UPGRADES"] = "Level 2 HighnNo Heroes",["LEVEL_3_TITLE"] = "Pagras",["LEVEL_4_HEROIC"] = "Hero Mode Description 4",["LEVEL_4_HISTORY"] = "Enemy forces are coming from the east through the Rocky Cliff Mountains, which only means that the Warhammer Fortress has fallen and the capital of our kingdom is in jeopardy. nnFrom the intelligence sent back by the spies, the best place to stop the enemy's advance is on the banks of the Twin River",["LEVEL_4_IRON"] = "Steel Mode Description 4",["LEVEL_4_IRON_UNLOCK"] = "unable to divide the tower nno artillery",["LEVEL_3_MODES_UPGRADES"] = "Level 2 HighnNo Heroes",["LEVEL_3_TITLE"] = "Pagras",["LEVEL_4_HEROIC"] = "Hero Mode Description 4",["LEVEL_4_HISTORY"] = "Enemy forces are coming from the east through the Rocky Cliff Mountains, which only means that the Warhammer Fortress has fallen and the capital of our kingdom is in jeopardy. nnFrom the intelligence sent back by the spies, the best place to stop the enemy's advance is on the banks of the Twin River",["LEVEL_4_IRON"] = "Steel Mode Description 4",["LEVEL_4_IRON_UNLOCK"] = "unable to divide the tower nno artillery",["LEVEL_4_MODES_UPGRADES"] = "Level 2 highestnNo heroes",["LEVEL_4_TITLE"] = "Twin Rivers",["LEVEL_5_HEROIC"] = "Hero Mode Description 5",["LEVEL_5_HISTORY"] = "After guarding the banks of the Twin Rivers and marching for several days, we finally came to the Silver Oak Forest Outpost... Aim to annihilate their troops in total! The garrison of the fortress has been subjected to several rounds of attacks in recent times, and their spies have reported that a wave of even larger enemy forces is approaching",["LEVEL_5_IRON"] = "Steel Mode Description 5",["LEVEL_5_IRON_UNLOCK"] = "no barracks",["LEVEL_5_MODES_UPGRADES"] = "up to level 3nno heroes",["LEVEL_5_TITLE"] = "Silver Oak Forest",["LEVEL_6_HEROIC"] = "Hero Mode Description 6",["LEVEL_6_HISTORY"] = "After several days of travel, we reached the capital, Linivia. The moment of decisive battle is coming, and we will definitely defend the wall of the southern gate to the death. In addition to your experienced troops, the King has sent two new units to join your faction. Arcane wizards can provide super firepower; And the devout paladin can inspire your troops with extraordinary courage",["LEVEL_6_IRON"] = "Steel Mode Description 6",["LEVEL_6_IRON_UNLOCK"] = "barracks only",["LEVEL_6_MODES_UPGRADES"] = "up to level 3nno heroes",["LEVEL_6_TITLE"] = "Battle of the Castle",["LEVEL_7_HEROIC"] = "Hero Mode Description 7",["LEVEL_7_HISTORY"] = "Our capital is safe, thank you, General! Now, our great Majesty the King has entrusted a safe passage to Valadur to defeat Weiznan and his army. The first stop on your journey will be the abandoned Cold Walk Mine, now home to the Hakraj troll tribe. To assist you in this mission, His Majesty's team of Royal Musketeers will join you",["LEVEL_7_IRON"] = "Steel Mode Description 7",["LEVEL_7_IRON_UNLOCK"] = "no barracksnno artillery",["LEVEL_7_MODES_UPGRADES"] = "up to level 3nno heroes",["LEVEL_7_TITLE"] = "Hanbu mine",["LEVEL_8_HEROIC"] = "Hero Mode Description 8",["LEVEL_8_HISTORY"] = "There is no colder place in these mountains than the Icy Wind Pass, but we must move forward. Our men have been besieged by Hakraj trolls for days, and spies have spotted enemy forces moving around us... And there are other enemies crazier than trolls ...",["LEVEL_8_IRON"] = "Steel Mode Description 8",["LEVEL_8_IRON_UNLOCK"] = "tower without bow and arrownunable to master tower",["LEVEL_8_MODES_UPGRADES"] =